import React from "react";
import { FooterCore } from "@axa-fr/react-toolkit-layout-footer";

const Footerr = () => {
  return (
    <FooterCore>
      <a href="https://www.axa.fr/">@ AXA 2018</a>
      <i>Tous droits réservés</i>
    </FooterCore>
  );
};

export default Footerr;
